import React, {Row} from 'react';
import NavbarComponent from './components/NavbarComponent';
import ListCategories from './components/ListCategories';

function App() {
  return (
    <div className="App">
     <NavbarComponent/>
     <Row>
       <ListCategories/>
     </Row>
    </div>
  );
}

export default App;
